import React, { useState } from "react"
export const Signup=()=>{
    const[data,setData]=useState({
        username:'',
        email:'',
        password:'',
        confirmpassword:'',
    })
    const{username,email,password,confirmpassword}=data;
    const handler=e=>{
setData({...data,[e.target.name]:[e.target.value]})
    }
    const submithandler=e=>{
        e.preventDefault();
        console.log(data);
    }
return(
    <div>
        <h1>Signup form</h1>
        <form onSubmit={submithandler}>
        <input type="text" name="username" placeholder="enter username" onChange={handler}  /><br/>
        <input type="email" name="email" placeholder="enter email" onChange={handler} /><br/>
        <input type="password" name="password" placeholder="enter password" onChange={handler} /><br/>
        <input type="password" name="confirm password" placeholder="enter confirm password" onChange={handler} /><br/>
<input type="submit" />
</form>
    </div>
)
}
